import styled from "styled-components";

const StyledRoom = styled.div`
  display: flex;
  flex-direction: column;
  min-width: 140px;
  border-style: solid;
  border-color: #ededed;
  border-radius: 5px;
  margin-bottom: 10px;
  margin-right: 10px;
`;

export default StyledRoom;
